window.bookSummaryJSON = "<p><b>Nora Devi is a xeno-archaeologist with a complicated past.</b></p> <p>She has buried more secrets than she’s dug up. Widowed in the recently ended twelve year war between Capitoline and Palantine, she now makes a living as an independent tagger in border space.</p> <p>Captain Liam Kimani could be credited with ending the latest royal war. Instead, he’s blamed for it. Dirty commoners aren’t meant to lay their hands on royalty.</p> <p>He has no regrets.</p> <p>When Liam and his crew of the battlecruiser RC Genghis Khan are exiled to Capitoline’s border they discover that life in unexplored space can be more dangerous than war, and that their best chance of survival lies with a mysterious, elusive tagger.</p> <p>The only problem is that Nora’s secrets might destroy the precarious stability of the entire Human Sector.</p> <p><i>Astray </i>is a fast-paced, enthralling space opera of lost societies, ancient aliens, rugged warriors and semi-legal pirates.</p>"; 
